import React from 'react'
import {useForm} from "react-hook-form";

function Support() {

  const {
    register,
    handleSubmit,
    formState: { errors },
    reset,
    } = useForm({
    mode: "onBlur"
    });

    const onSubmit = (data) => {
    alert(JSON.stringify(data));
    reset();
    }

  return (
    <>
    <p className="title-support">Support</p>
    <p className="subtitle-support">Subscribe Newsletter & get</p>
    <p className="bank-news">Bank News</p>

    <form onSubmit={handleSubmit(onSubmit)}>
    <input type="email" placeholder="Your email" />
    <label>
    <input {...register('amount', { required: true, min: 15000, max: 600000})} />
    </label>
    <div >{errors?.amount && <p>Wrong amount</p>}</div>
    <input id="btn-support" className="btn-support" type="submit" value="Subscribe"/>
      </form>
    </>
  )
}

export default Support
